import React from 'react';

import Sidebar from 'react-sidebar';

const sidebar = () => {
    return (
        <Sidebar
          sidebar={<b>Sidebar content</b>}
          open={true}
          onSetOpen={true}
          styles={sidebar}
        >
          abcdsadasds
        </Sidebar>
      );
};

export default sidebar;
